                    description = helptext = "0 = all preconditions fulfilled 1 = Purge.ST_HighPriority == TRUE 2 = In.T_Catalyst <= CatDiagCal.T_CatMin 3 = In.T_Catalyst >= CatDiagCal.T_CatMax 4 = Engine temp above temp hysterece 5 = Interface.runTime() < CatDiagCal.t_FromStartMin 6 = No fault in T_Exhaust sensor, only used if sensor present 7 = No fault in U_O2SensFront sensor 8 = No fault in U_O2SensRear sensor 9 = No fault in Q_AirInlet sensor 10 = obdCat.N_DiagHasPerformed > CatDiagCal.N_MaxDiag2Run 11 = obdCat.ST_Active == 0 && obdCat.Trq_ReqCatDiag > 0 12 = No rationality test is allowed message from diagnostic core 14 = Another diagnose has run priority 15 = SAI workshop test is running 16 = Engine speed is below calibrated value at diagnos start";
