                case "obdEvap.v_DiffNegMax":
                    description = helptext = "The biggest negative diff of vehicle speed from obdEvap.v_VehicleSpeedPrecondition.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_FuelTankFilt":
                    description = helptext = "Tank pressure signal, low pass filtrated.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_PreviousPressure":
                    description = helptext = "Last read pressure in fuellevel ripple.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp0":
                    description = helptext = "Max positive pressure reading during ramp0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp0":
                    description = helptext = "Max negative pressure reading during ramp0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp1":
                    description = helptext = "Max positve pressure reading during ramp1.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp1":
                    description = helptext = "Max negative pressure reading during ramp1.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxPosRamp2":
                    description = helptext = "Max positve pressure reading during ramp2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_MaxNegRamp2":
                    description = helptext = "Max negative pressure reading during ramp2.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.p_SwitchPoint":
                    description = helptext = "The lowest pressure when ramp2 starts.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_OkStatus":
                    description = helptext = "Shows EvaporatorDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = EVAP_SYSTEM_LEAK_DETECTED_SMALL_LEAK has reported ok Bit 1 = EVAP_SYSTEM_LEAK_DETECTED_SMALL_LEAK_FUEL has reported ok Bit 2 = EVAP_SYSTEM_LEAK_DETECTED_GROSS_LEAK has reported ok Bit 3 = EVAP_SYSTEM_LEAK_DETECTED_GROSS_LEAK_FUEL has reported ok Bit 4 = EVAP_SYSTEM_LEAK_DETECTED_VERY_SMALL_LEAK has reported ok Bit 5 = EVAP_SYSTEM_LEAK_DETECTED_VERY_SMALL_LEAK_FUEL has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_FaultCode":
                    description = helptext = "Shows EvaporatorDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.LeakageResult":
                    description = helptext = "This variable contains the result from the matrix table";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_FilterIgnoredByColdStart":
                    description = helptext = "If obdEvap.ST_ColdStart was enabled during test and test shpuld have aborted due HC consentration or lambda during test, this variable will be set and it will stop the test to report small leak. The variable also keeps track of which test is ignored (Bit 1 = Test 1, Bit 2 = Test 2)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.DiagState":
                    description = helptext = "Shows the evap diagnose all different states : 0 = ignition off 1 = diagnose interrupted 2 = precondition OK 3 = test phase 0 condition during test OK 4 = test phase 0 OK 5 = test phase 1 condition during test OK 6 = test phase 2 OK 7 = test phase 2 condition during test OK 8 = diagnose done, either ok or fault";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ActiveTest":
                    description = helptext = "1 - 0,5 mm test with no vehicle speed 2 - 1mm -> test with vehicle speed 3 - big leak, filler cap";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.BreakPreCondition":
                    description = helptext = "1 = obdEvap.ST_NeedForSpeed = 1 2 = In.v_Vehicle < pEvapTestCal->v_loLim or In.v_Vehicle > pEvapTestCal->v_hiLim 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod.test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 7 = obdFuelDetermination.ST_CheckDone = 0 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 9 = In.T_Engine < PurgeCal.T_EngineLim if obdEvap.ST_ColdStart = 1, else AdpFuel.ST_PurgeAllow = 0 10 = obdEvap.ST_ColdStart = 0 and purgeFirstStartRampOK = 0 12 = Purge.p_DiffNormal > -150 13 = Purge.AdaptionEvap < pEvapTestCal->PurgeloLim 14 = obdpTankAdap.ST_FaultCode > 0 15 = In.v_Vehicle has not been more than 44 Km/h for more than EvapTestCal->t_breakWaitTime 16 = PowerTrainRelay diagnosis has reported fault 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = Fault.v_Vehicle > 0 21 = obdCCV.ST_FaultCode > 0 22 = OBDAdap.ST_PurgeFault > 0 23 = obdBrakeLight.ST_FaultCode > 0 24 = obdTEng.ST_FaultCode > 0 25 = obdTAir.ST_FaultCode > 0 27 = obdEvap.ST_FillerCapTestDone = 1 and obdEvap.ActiveTest = 3 28 = The start was not a powerup and obdEvap.ActiveTest is not 3 29 = Lambda.Status > 0, T9: WBLam.ST_Control or LamMast.ST_ActiveLambdaReq is not 4 30 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 31 = obdEvap.N_VapourTest1 >= EvapDiagCal.N_VapourLimTest1 and obdEvap.ActiveTest = 1 (No more Test1 attempts, due to too many Test1 have been aborted by evaporaion) 32 = obdEvap.N_VapourTest2 >= EvapDiagCal.N_VapourLimTest2 and obdEvap.ActiveTest = 2 (No more Test2 attempts, due to too many Test2 or Test3 have been aborted by evaporation.) 33 = ManifoldAbsolutePressureSensor diagniosis has reported fault 34 = obdCCV.ST_ActiveRationality = 1 (the purge valve may already be controlled) 35 = obdCore.ST_DiagPriority is not 0 (another diagnose has run priority) 36 = obdSAI.WSDiagState is not 0 (SAI workshop test is running) 37 = Purge.ST_O2SensDiagFreeze nonzero (O2S Response test is running) 38 = The engine is running on idle and obdevap.activetest is 2 or 3 39 = TAmbMod.T_AirAmbient < EvapDiagCal.T_LoLim or TAmbMod.T_AirAmbient > EvapDiagCal.T_AmbHiLim 40 = TAmbMod.T_AirAmbAtStart < EvapDiagCal.T_LoLim or obdCore.T_AirInletStart < EvapDiagCal.T_LoLim";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.BreakCondDurTest":
                    description = helptext = "2 = In.v_Vehicle < (obdEvap.v_VehicleSpeedPrecondition - pEvapTestCal->v_Diff) or In.v_Vehicle > (obdEvap.v_VehicleSpeedPrecondition + pEvapTestCal->v_Diff) 3 = obdFuelDetermination.V_FuelTankFilt <= EvapDiagCal.V_FuelMin (-4L for prod. test) 4 = obdFuelDetermination.V_FuelTankFilt >= EvapDiagCal.V_FuelMax 5 = Fault.p_FuelTank > 0 (electrical or rationality error on ptank) 6 = obdEvap.p_FuelTankFilt >= EvapDiagCal.p_MaxTank (+200Pa for prod.test) 8 = obdEvap.n_BrakeChanges >= pEvapTestCal->n_BrakeChangeLim (+5 for Production- and Workshop-test) 12 = Purge.p_DiffNormal >= -150 and obdEvap.DiagState < 6 13 = Purge.HCCont > (obdEvap.HCContPrecondition + pEvapTestCal->HCContDiff) 14 = m_Delta > EvapDiagCal.m_Delta or m_Delta < (0 - EvapDiagCal.m_Delta) 17 = FCut.ST_FuelCut = 1 18 = obdEvap.p_AirAmbientDelta > pEvapTestCal->p_AirAmbientDelta 19 = If obdEvap.p_AirAmbientDelta has been out of limit for active test. This will stop active test for rest of the DCY 20 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_MinTank 21 = obdEvap.ST_ValveLockedByDiagnose = 1 and Purge.Status is not 6 22 = Purge.DiagFlow > 0 and Out.PWM_PurgeValve <= 0 34 = obdEvap.Ramp0 < EvapDiagCal.ramp0LoLim 35 = The engine is running on idle and obdevap.activetest is 2 or 3 36 = Purgeflow is too low due to max fuelfactor 101 = obdEvap.p_FuelTankFilt < pEvapTestCal->p_Level1Ramp1 first time in ramp 1 102 = Fuellevelripple determined 103 = obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim 105 = obdEvap.DiffR2Result[i] >= EvapDiagCal.maxPosR2Diff (Fuellevelripple during ramp2 evaluation small pos direction) 106 = obdEvap.DiffR2Result[i] < EvapDiagCal.maxNegR2Diff (Fuellevelripple during ramp2 evaluation small neg direction) 108 = T8: If Lambda.LambdaInt diff of obdEvap.LambdaPrecondition T9: If (WBLam.FuelFac - 1.0) diff of obdEvap.LambdaPrecondition 150 -> 200 = Big leak errors detected, needed 2 for error report when ignition off 254 = OBDAdapEvap.Evap2BigResDiff > 0";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.n_BrakeChanges":
                    description = helptext = "Saves nr of times that brake signal has been changed.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.N_VapourTest1":
                    description = helptext = "If obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim and active test is 1 this variable will be increased.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.N_VapourTest2":
                    description = helptext = "If obdEvap.Ramp0 > pEvapTestCal->ramp0HiLim and active test is 2 this variable will be increased.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.n_BigLeakErrorCnt":
                    description = helptext = "Number of tests that discovered big leak. If > 2 then report fault (BIG_LEAK) at ignition off. Will be cleard when a OK report";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ColdStart":
                    description = helptext = "If temperature is regared as cold start this flag is set. If temperature goes out of limits then it's clered. During workshop test there is an offset of +15 added to EvapDiagCal.T_HiLim. Cold start definition : if ((obdCore.T_EngineStart > EvapDiagCal.T_LoLim) && (obdCore.T_EngineStart < EvapDiagCal_T_HiLim) && (obdCore.T_AirInletStart > EvapDiagCal.T_LoLim) && (obdCore.T_AirInletStart < EvapDiagCal_T_HiLim) && (In.T_AirInlet < EvapDiagCal.T_LoLim))";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_CCVMayBeStuck":
                    description = helptext = "If In.p_FuelTank < pEvapTestCal->MinTankPressure then there is a possibillity that CCV can be stucked.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ValveLockedByDiagnose":
                    description = helptext = "Indicates that evap is using valves for diagnose.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_NeedForSpeed":
                    description = helptext = "If a test is interruped or if test 2 is finished this flag is set. It will reset after Vehicle speed > 0.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_IsRunning":
                    description = helptext = "Shows if diagnose is running.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_RequestElevatedIdle":
                    description = helptext = "Shows if Evap has requested elevated idle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_ProductionTest":
                    description = helptext = "Shows status of Evap Production test. 0 = Test not done or not ready yet. 1 = Test OK. 2 = Leakage detected.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_WorkshopTest":
                    description = helptext = "Shows status of Evap Workshop test. 0 = Test not done or not ready yet. 1 = Test OK. 2 = Leakage detected. 3 = Test aborted due to vapour.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdEvap.ST_DiagPrevRestOfDrvCycle":
                    description = helptext = "Indicates if diagnose is prevented from running for the rest of this driving cycle.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_OkStatus":
                    description = helptext = "Shows CanisterCloseValveDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = CMD_PURGEDIAG_LOW has reported ok Bit 1 = CMD_PURGEDIAG_HIGH has reported ok Bit 2 = CMD_PURGEDIAG_MALFUNCTION has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_FaultCode":
                    description = helptext = "Shows CanisterCloseValveDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.t_Error":
                    description = helptext = "Time with pressure between min pressure limit and ok limit.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.p_RefLim":
                    description = helptext = "Lowest pressure saved, used to se if pressure has retained within limits.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_DiagDone":
                    description = helptext = "CCV diagnose device check done (Close Canister Valve)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.N_CleanCounter":
                    description = helptext = "CCV (Canister Close Valve) cleaning function counter. Toggles valve for approx. 100 ms four times on/off (counter = 8).";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_PurgeClosedByDiagnose":
                    description = helptext = "The Purge valve is closed by this diagnose during the rationality test.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdCCV.ST_ActiveRationality":
                    description = helptext = "CCV diagnose is running the rationality test. During this test the diagnose somtimes take control over the purge valve. This flag is read by the evap diagnose as a precondition since the evap diagnose also wants to take control over the purge valve.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_OkStatus":
                    description = helptext = "Shows PurgeValveDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = EVAP_SYSTEM_PURGE_CONTROL_VALVE_CIRCUIT_OPEN has reported ok Bit 1 = EVAP_SYSTEM_PURGE_CONTROL_VALVE_CIRCUIT_SHORTED has reported ok Bit 2 = EVAP_SYSTEM_INCORRECT_PURGE_FLOW has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_FaultCode":
                    description = helptext = "Shows PurgeValveDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.Ramp0":
                    description = helptext = "Ramp 0 result. How much vapour is it";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.BreakPreCondition":
                    description = helptext = "1 = In.v_Vehicle > 0 2 = obdPurge.ST_NeedForSpeed > 0 3 = obdPurge.ST_DiagDone = 1 4 = obdCore.T_AirInletStart < EvapDiagCal.T_LoLim 5 = obdCore.T_AirInletStart > EvapDiagCal.T_HiLim 6 = obdCore.T_EngineStart < EvapDiagCal.T_LoLim 7 = obdCore.T_EngineStart > EvapDiagCal.T_HiLim 8 = Purge.p_DiffNormal > -150 9 = Purge.Status is not 0 (Off) or 6 (Controlled by diagnose) 10 = obdCCV.ST_FaultCode > 0 11 = obdTEng.ST_FaultCode > 0 12 = obdABS.ST_FaultCode > 0 13 = obdCore.ST_FirstDCYAfterPowerUp = 0 14 = obdpTank.ST_FaultCode > 0";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_ActiveDiag":
                    description = helptext = "Purge diagnose rationality state 0 = Not active 1 = Active 2 = Fault determined, but waiting to report";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_DiagDone":
                    description = helptext = "Purge diagnose is done";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdPurge.ST_NeedForSpeed":
                    description = helptext = "Run Purgediagnose only one standing still sequence, when require vehicle speed > 0";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.PendingDTC":
                    description = helptext = "Information from the Fault Manager about if any of these diagnoses has a pending fault code stored. This solution is chosen to save execution time. Insted of 6(nr of pos in FM) x 26(nr of diag to be checked) loops, there are 6 loops with a switch/case control structure. BIT 28 - diag_ExhaustGasTemperatureSensor BIT 27 - diag_TurboChargerBoostSensor BIT 26 - diag_PowerTrainRelay BIT 25 - diag_BrakeLightSignal BIT 24 - diag_FuelTankPressureAdap BIT 23 - diag_FuelTankPressure BIT 22 - diag_Pedal BIT 21 - diag_AirPresSensDev BIT 20 - diag_BarometicPressureSensor BIT 19 - diag_IntakeAirTemperatureSensor BIT 18 - diag_ABSCANDataError BIT 17 - diag_ECMInternal BIT 16 - diag_Evaporator BIT 15 - diag_SecondaryAirSystem BIT 14 - diag_O2SensorPreRespons BIT 13 - diag_PurgeValve BIT 12 - diag_O2SensorPreSwitchPoint BIT 11 - diag_CanisterCloseValve BIT 10 - diag_CrankShaftPositionSensor BIT 9 - diag_O2SensorPostHeater BIT 8 - diag_O2SensorPost BIT 7 - diag_O2SensorPreHeater BIT 6 - diag_O2SensorPre BIT 5 - diag_EngineCoolantSystem BIT 4 - diag_EngineCoolantTemperatureSensorDeviation BIT 3 - diag_EngineCoolantTemperatureSensor BIT 2 - diag_ManifoldAbsolutePressureSensor BIT 1 - diag_MassAirFlowSensor BIT 0 - diag_CatIdle";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.t_EnableCond1Timer":
                    description = helptext = "The timer for enable condition 1, for denominator";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.t_EnableCond2Timer":
                    description = helptext = "The timer for enable condition 2, for denominator";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.t_EnableCond3Timer":
                    description = helptext = "The timer for enable condition 3, for denominator";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.t_EnableCond4Timer":
                    description = helptext = "The timer for enable condition 4, for denominator";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_EnableCond1Den":
                    description = helptext = "Enable condition 1, for denominator has been fulfilled (1)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_EnableCond2Den":
                    description = helptext = "Enable condition 2, for denominator has been fulfilled (1)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_EnableCond3Den":
                    description = helptext = "Enable condition 3, for denominator has been fulfilled (1)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_EnableCond4Den":
                    description = helptext = "Enable condition 4, for denominator has been fulfilled (1)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_EnableCond5Den":
                    description = helptext = "Enable condition 5, for denominator has been fulfilled (1)";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "RMProt.ST_DisableCriteria1":
                    description = helptext = "Disable Criteria 1 fulfilled (1), for denominator and numerator.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "DigIDM.knockSignalEvalResult":
                    description = helptext = "This array is used to store fault information for DigitalIDM Diagnosis. If all DTC:s has reported ok, the first position of the array contains \"1\", otherwise the positions will be orderly filled with IDMfaultStatus describing each unique fault detected. This array is used as an interface between C and C++ functions for Digital IonDetectModule Diagnosis. 2 = KNOCK_CONTROL_SYSTEM_RANDOM_ELECTRICAL_SPARK_TRIG_FAULT 3 = KNOCK_CONTROL_SYSTEM_CYLINDER_1_ELECTRICAL_SPARK_TRIG_FAULT 4 = KNOCK_CONTROL_SYSTEM_CYLINDER_2_ELECTRICAL_SPARK_TRIG_FAULT 5 = KNOCK_CONTROL_SYSTEM_CYLINDER_3_ELECTRICAL_SPARK_TRIG_FAULT 6 = KNOCK_CONTROL_SYSTEM_CYLINDER_4_ELECTRICAL_SPARK_TRIG_FAULT 7 = KNOCK_CIRCUIT_NO_ACTIVITY fault present";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "DigIDM.Cnt_SampleKnockSignal":
                    description = helptext = "Counts the number of samples from all cylinders, when limit (16) is exceeded, an evaluation of knocksignal samples is performed. Digital IDM only.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "DigIDM.Cnt_HighKnockSignal":
                    description = helptext = "Counts the number of high knocksignal samples, ActualIn.X_Knock > 0, for each cylinder. Digital IDM only.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "DigIDM.Cnt_LowKnockSignal":
                    description = helptext = "Counts the number of low knocksignal samples, ActualIn.X_Knock == 0, for each cylinder. Digital IDM only.";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdDigIDM.ST_OkStatus":
                    description = helptext = "Shows IonDetectModuleDiag diagnose functions OK status. 0 = no faultcode has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdDigIDM.ST_FaultCode":
                    description = helptext = "Shows IonDetectModuleDiag diagnose functions Fault status. 0 = no faultcode >0 = faultcode number Blinking number = Diagnose has depend to other diagnoses";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
                    break;
                case "obdIDM.ST_OkStatus":
                    description = helptext = "Shows IonDetectModuleDiag diagnose functions OK status. 0 = no faultcode has reported ok Bit 0 = ION_DETECT_MODULE has reported ok FFFF = Diagnose OK complete";
                    category = XDFCategories.Undocumented;
                    subcategory = XDFSubCategory.Undocumented;
