                    description = helptext = "1 = obdEGT.n_EngineFilt > (stored obdEGT.n_EngineFilt + EGTDiagCal.n_ShortSteadyState) 2 = obdEGT.n_EngineFilt < (stored obdEGT.n_EngineFilt - EGTDiagCal.n_ShortSteadyState) 3 = obdEGT.p_AirInletFilt > (stored obdEGT.p_AirInletFilt + EGTDiagCal.p_ShortSteadyState) 4 = obdEGT.p_AirInletFilt < (stored obdEGT.p_AirInletFilt - EGTDiagCal.p_ShortSteadyState) 5 = obdEGT.fi_IgnitionFilt > (stored obdEGT.fi_IgnitionFilt + EGTDiagCal.fi_ShortSteadyState) 6 = obdEGT.fi_IgnitionFilt < (stored obdEGT.fi_IgnitionFilt - EGTDiagCal.fi_ShortSteadyState) 7 = obdEGT.LambdaFilt > (stored obdEGT.LambdaFilt + EGTDiagCal.Lambda_ShortSteadyState) 8 = obdEGT.LambdaFilt < (stored obdEGT.LambdaFilt - EGTDiagCal.Lambda_ShortSteadyState) 9 = obdEGT.T_AirInletFilt > (stored obdEGT. T_AirInletFilt + EGTDiagCal.T_ShortSteadyState) 10 = obdEGT.T_AirInletFilt < (stored obdEGT. T_AirInletFilt - EGTDiagCal.T_ShortSteadyState)";
